      final PdfDocument doc = PdfDocument();
      final PdfPage page = doc.pages.add();
      final PdfFont font = PdfStandardFont(PdfFontFamily.helvetica, 16);
      page.graphics.drawString('Layers', font,
          brush: PdfBrushes.darkBlue,
          bounds: const Offset(150, 10) & const Size(400, 50));
      //Add the first layer
      final PdfPageLayer layer = page.layers.add(name: 'Layer1');
      PdfGraphics graphics = layer.graphics;
      graphics.translateTransform(100, 60);
      final PdfPen pen = PdfPen(PdfColor(250, 0, 0), width: 50);
      const Rect rect = Rect.fromLTWH(0, 0, 50, 50);
      graphics.drawArc(rect, 360, 360, pen: pen);

      //Add another layer on the page.
      final PdfPageLayer layer2 = page.layers.add(name: 'Layer2');
      graphics = layer2.graphics;
      graphics.translateTransform(100, 180);
      graphics.drawEllipse(rect, pen: pen);

      final List<int> bytes = doc.saveSync();
      expect(bytes.isNotEmpty, true,
          reason: 'Failed to draw layers in PDF document');
      savePdf(bytes, 'FLUT-2666-layersSample1.pdf');
      doc.dispose();
